(1, 'CARDAPIO 1', '<table border=\"1\" cellspacing=\"0\" style=\"width:699.1pt\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:67.5pt; width:33.05pt\">\r\n			<p><strong>1</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#4472c4; height:67.5pt; width:199.8pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p><strong>Um copo de leite de am&ecirc;ndoas ou de aveia + uma fatia de p&atilde;o integral.</strong></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"background-color:#4472c4; height:67.5pt; width:226.35pt\">\r\n			<p><strong>Peixe cozido + babata cozida + salada &nbsp;de couves, repolho, cebola,&nbsp; beterraba e cenoura (cozido a vapor).</strong></p>\r\n\r\n			<p><strong>( Peixe salm&atilde;o, corvina, ou garoupa).</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#4472c4; height:67.5pt; width:239.9pt\">\r\n			<p><strong>Salada de frutas</strong></p>\r\n\r\n			<p><strong>Melancia + mel&atilde;o e mam&atilde;o. </strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>2</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:199.8pt\">\r\n			<p>Suco de Anan&aacute;s e Gengibre ao acordar at&eacute; 11h.</p>\r\n\r\n			<p>Dois anan&aacute;s 1 litro d&acute; &aacute;gua morna e gengibre.</p>\r\n\r\n			<p>N&atilde;o ado&ccedil;ar.</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:226.35pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Ab&oacute;bora cozida + molho de tomate, feij&atilde;o-verde e br&oacute;colis.</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:239.9pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Papa de flocos de aveia feito com leite de am&ecirc;ndoas e acompanhar com mam&atilde;o e banana.</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>3</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:199.8pt\">\r\n			<p>Salada de frutas: Mam&atilde;o e banana (uma banana e 1/3 de mam&atilde;o) + um copo de leite de aveia.</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:226.35pt\">\r\n			<p>Peixe grelhado + salada quente,</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>(Peixe salm&atilde;o, corvina, ou garoupa).</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:239.9pt\">\r\n			<p>Um copo de leite de am&ecirc;ndoas + p&atilde;o integral.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>4</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:199.8pt\">\r\n			<p>Suco de pepino ao acordar at&eacute; 11h.</p>\r\n\r\n			<p>Centrifugar 15 pepinos nutridos e tomar o rico suco. N&atilde;o ado&ccedil;ar.</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:226.35pt\">\r\n			<p>Salada quente; Repolho, br&oacute;colis, couves, cenoura, feij&atilde;o-verde., meia cebola e beterraba + batata-doce.</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:239.9pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Das 16h tomar o suco de anan&aacute;s com gengibre.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>5</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:199.8pt\">\r\n			<p>Flocos de aveia + chia, feito com leite de am&ecirc;ndoas ou aveia.</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:226.35pt\">\r\n			<p>Funge de milho fei&atilde;jo, kizaca ou calulu de peixe.</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:239.9pt\">\r\n			<p>Sopa de pur&ecirc; de ab&oacute;bora com agri&atilde;o e outros legumes a gosto.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>6</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:199.8pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Suco de mel&atilde;o ao acordar at&eacute; 11h.</p>\r\n\r\n			<p>N&atilde;o ado&ccedil;ar</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:226.35pt\">\r\n			<p>Arroz integral + feij&atilde;o + uma posta de peixe com salada de couves,</p>\r\n\r\n			<p>(As couves depois de bem lavadas, cortejar e cozer durante 2 minutos a vapor)</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:239.9pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Das 16h tomar o suco de anan&aacute;s gengibre.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>7</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:199.8pt\">\r\n			<p>Flocos de aveia + Mam&atilde;o e sementes de linha&ccedil;a.</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:226.35pt\">\r\n			<p>Arroz integral e salada com bastante abacate e ovos biol&oacute;gico.</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:239.9pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Das 16h tomar o suco de anan&aacute;s com gengibre.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>8</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:199.8pt\">\r\n			<p>Suco de melancia durante todo per&iacute;odo matinal.</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:226.35pt\">\r\n			<p>Ab&oacute;bora cozida + molho de tomate + peixe grelhado. Peixe salm&atilde;o, corvina, ou garoupa.</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:239.9pt\">\r\n			<p>Leite de flocos de aveia e chia</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>9</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:199.8pt\">\r\n			<p>Suco de Melancia ao despertar at&eacute; &agrave;s 11h.</p>\r\n\r\n			<p>N&atilde;o ado&ccedil;ar</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:226.35pt\">\r\n			<p>Massa integral e feij&atilde;o + salada.</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:239.9pt\">\r\n			<p>Salada de frutas: Mel&atilde;o e Melancia e mam&atilde;o.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>10</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:199.8pt\">\r\n			<p>Flocos de aveia + chia.</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:226.35pt\">\r\n			<p>Salada de vegetais e inhame.</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:239.9pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Das 16h tomar o suco de&nbsp; mel&atilde;o com gengibre.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>11</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:199.8pt\">\r\n			<p>Suco de Anan&aacute;s ao acordar.</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:226.35pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Cozido</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:239.9pt\">\r\n			<p>Papa de flocos de aveia com cereais + leite de am&ecirc;ndoas.</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>12</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:199.8pt\">\r\n			<p>Sopa de pur&ecirc; de ab&oacute;bora + uma fatia de p&atilde;o integral</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:226.35pt\">\r\n			<p>Arroz integral e prote&iacute;nas de soja.</p>\r\n\r\n			<p>Courget, tomate,&nbsp; pepino e cebola rocha</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:239.9pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Das 16h tomar o suco de anan&aacute;s com gengibre.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>13</strong></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:199.8pt\">\r\n			<p>Um copo de leite de aveia + uma fatia de p&atilde;o integral</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:226.35pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Salada de alface e abacate. Peixe cozido a vapor.</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:239.9pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Salada de frutas a gosto.</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>14</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:199.8pt\">\r\n			<p>Suco de Anan&aacute;s e Gengibre ao acordar at&eacute; 11h.</p>\r\n\r\n			<p>Dois anan&aacute;s&nbsp; 1 litro d&acute; &aacute;gua morna e gengibre.</p>\r\n\r\n			<p>N&atilde;o ado&ccedil;ar.</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:226.35pt\">\r\n			<p>Arroz integral e feij&atilde;o preto.</p>\r\n\r\n			<p>Salada de couves.</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:239.9pt\">\r\n			<p>Papa de flocos de aveia com cereais + leite de am&ecirc;ndoas.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>15</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:199.8pt\">\r\n			<p>Suco de anan&aacute;s at&eacute; &agrave;s 11h.</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:226.35pt\">\r\n			<p>Berinjelas,&nbsp; Milho fervido. Molho de tomate.</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:239.9pt\">\r\n			<p>Suco de M'),
(2, 'CARDAPIO 5', '<table border=\"1\" cellspacing=\"0\" style=\"width:699.1pt\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>DlDIAS</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:199.8pt\">\r\n			<p><strong>PEQUENO ALMO&Ccedil;O&nbsp; (5/7H)</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:226.35pt\">\r\n			<p><strong>ALMO&Ccedil;O 13H</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:239.9pt\">\r\n			<p><strong>&Uacute;LTIMA REFEI&Ccedil;&Atilde;O 18/19H</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:67.5pt; width:33.05pt\">\r\n			<p><strong>1</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:67.5pt; width:199.8pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Um copo de leite de am&ecirc;ndoas ou de aveia + uma fatia de p&atilde;o integral.</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:67.5pt; width:226.35pt\">\r\n			<p>Peixe cozido + babata cozida + salada &nbsp;de couves, repolho, cebola,&nbsp; beterraba e cenoura (cozido a vapor).</p>\r\n\r\n			<p>( Peixe salm&atilde;o, corvina, ou garoupa).</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:67.5pt; width:239.9pt\">\r\n			<p>Salada de frutas</p>\r\n\r\n			<p>Melancia + mel&atilde;o e mam&atilde;o.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>2</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:199.8pt\">\r\n			<p>Suco de Anan&aacute;s e Gengibre ao acordar at&eacute; 11h.</p>\r\n\r\n			<p>Dois anan&aacute;s 1 litro d&acute; &aacute;gua morna e gengibre.</p>\r\n\r\n			<p>N&atilde;o ado&ccedil;ar.</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:226.35pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Ab&oacute;bora cozida + molho de tomate, feij&atilde;o-verde e br&oacute;colis.</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:239.9pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Papa de flocos de aveia feito com leite de am&ecirc;ndoas e acompanhar com mam&atilde;o e banana.</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>3</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:199.8pt\">\r\n			<p>Salada de frutas: Mam&atilde;o e banana (uma banana e 1/3 de mam&atilde;o) + um copo de leite de aveia.</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:226.35pt\">\r\n			<p>Peixe grelhado + salada quente,</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>(Peixe salm&atilde;o, corvina, ou garoupa).</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:239.9pt\">\r\n			<p>Um copo de leite de am&ecirc;ndoas + p&atilde;o integral.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>4</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:199.8pt\">\r\n			<p>Suco de pepino ao acordar at&eacute; 11h.</p>\r\n\r\n			<p>Centrifugar 15 pepinos nutridos e tomar o rico suco. N&atilde;o ado&ccedil;ar.</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:226.35pt\">\r\n			<p>Salada quente; Repolho, br&oacute;colis, couves, cenoura, feij&atilde;o-verde., meia cebola e beterraba + batata-doce.</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:239.9pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Das 16h tomar o suco de anan&aacute;s com gengibre.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>5</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:199.8pt\">\r\n			<p>Flocos de aveia + chia, feito com leite de am&ecirc;ndoas ou aveia.</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:226.35pt\">\r\n			<p>Funge de milho fei&atilde;jo, kizaca ou calulu de peixe.</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:239.9pt\">\r\n			<p>Sopa de pur&ecirc; de ab&oacute;bora com agri&atilde;o e outros legumes a gosto.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>6</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:199.8pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Suco de mel&atilde;o ao acordar at&eacute; 11h.</p>\r\n\r\n			<p>N&atilde;o ado&ccedil;ar</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:226.35pt\">\r\n			<p>Arroz integral + feij&atilde;o + uma posta de peixe com salada de couves,</p>\r\n\r\n			<p>(As couves depois de bem lavadas, cortejar e cozer durante 2 minutos a vapor)</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:239.9pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Das 16h tomar o suco de anan&aacute;s gengibre.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>7</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:199.8pt\">\r\n			<p>Flocos de aveia + Mam&atilde;o e sementes de linha&ccedil;a.</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:226.35pt\">\r\n			<p>Arroz integral e salada com bastante abacate e ovos biol&oacute;gico.</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:239.9pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Das 16h tomar o suco de anan&aacute;s com gengibre.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>8</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:199.8pt\">\r\n			<p>Suco de melancia durante todo per&iacute;odo matinal.</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:226.35pt\">\r\n			<p>Ab&oacute;bora cozida + molho de tomate + peixe grelhado. Peixe salm&atilde;o, corvina, ou garoupa.</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:239.9pt\">\r\n			<p>Leite de flocos de aveia e chia</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>9</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:199.8pt\">\r\n			<p>Suco de Melancia ao despertar at&eacute; &agrave;s 11h.</p>\r\n\r\n			<p>N&atilde;o ado&ccedil;ar</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:226.35pt\">\r\n			<p>Massa integral e feij&atilde;o + salada.</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:239.9pt\">\r\n			<p>Salada de frutas: Mel&atilde;o e Melancia e mam&atilde;o.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>10</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:199.8pt\">\r\n			<p>Flocos de aveia + chia.</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:226.35pt\">\r\n			<p>Salada de vegetais e inhame.</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:239.9pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Das 16h tomar o suco de&nbsp; mel&atilde;o com gengibre.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>11</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:199.8pt\">\r\n			<p>Suco de Anan&aacute;s ao acordar.</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:226.35pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Cozido</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:239.9pt\">\r\n			<p>Papa de flocos de aveia com cereais + leite de am&ecirc;ndoas.</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>12</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:199.8pt\">\r\n			<p>Sopa de pur&ecirc; de ab&oacute;bora + uma fatia de p&atilde;o integral</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:226.35pt\">\r\n			<p>Arroz integral e prote&iacute;nas de soja.</p>\r\n\r\n			<p>Courget, tomate,&nbsp; pepino e cebola rocha</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:239.9pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Das 16h tomar o suco de anan&aacute;s com gengibre.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>13</strong></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:199.8pt\">\r\n			<p>Um copo de leite de aveia + uma fatia de p&atilde;o integral</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:226.35pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Salada de alface e abacate. Peixe cozido a vapor.</p>\r\n			</td>\r\n			<td style=\"background-color:#b4c6e7; height:9.6pt; width:239.9pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Salada de frutas a gosto.</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:#4472c4; height:9.6pt; width:33.05pt\">\r\n			<p><strong>14</strong></p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:199.8pt\">\r\n			<p>Suco de Anan&aacute;s e Gengibre ao acordar at&eacute; 11h.</p>\r\n\r\n			<p>Dois anan&aacute;s&nbsp; 1 litro d&acute; &aacute;gua morna e gengibre.</p>\r\n\r\n			<p>N&atilde;o ado&ccedil;ar.</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:226.35pt\">\r\n			<p>Arroz integral e feij&atilde;o preto.</p>\r\n\r\n			<p>Salada de couves.</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"background-color:#d9e2f3; height:9.6pt; width:239.9pt\">\r\n			<p>Papa de flocos de aveia com cereais + leite de am&ecirc;ndoas.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td st'),
