(319, 436, '2021-02-17', '0', '0', '0', '0', NULL, NULL, '2021-02-17', '', '', '', '', '', '<p>Paciente de <strong>42</strong> Anos sem gesta&ccedil;&atilde;o alguma, vida sexual activaaos 20 anos de idade. Em&nbsp; 2017 come&ccedil;aram a seguir tratamento de infertilidade. Em 2019 enveredaram a medica&ccedil;&atilde;o na Videira Nguepe por 6 Meses,&nbsp;Periodo menstrual regular, j&aacute; teve amenorreia de 9 meses (uma das causas <strong>miomas uterino</strong>) fez o tratamento natural de remo&ccedil;&atilde;o de miomas e o tratamento teve&nbsp;exito isso em 2020. Paciente <s>SeRo Positiva </s>desde.</p>\r\n\r\n<p>O Parceiro tem epis&oacute;dio de diabete, Hiperten&ccedil;&atilde;o Arterial e toma Solatam 50mg/12.</p>\r\n'),
(320, 439, '2021-02-18', '0', '0', '0', '0', NULL, NULL, '2021-02-18', '', '', '', '', '', '<p>PACIENTE DE 32&nbsp;ANOS DE IDADE SEM NENHUMA GESTA&Ccedil;&Atilde;O. RELA&Ccedil;&Atilde;O SEXUAL ACTIVA DESDE OS 17 ANOS DE IDADE. N&Atilde;O TEM MIOMA, TEVE UMA CIRURGIA DE RETIRADA DE QUISTO EM 2015&nbsp;NA MATERNIDADE NGANGULA. PERIODO MENSTRUAL REGULAR.</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(321, 438, '2021-02-18', '58.5', '0', '0', '0', NULL, NULL, '2021-02-18', '', '', '', '', '', '<p>PACIENTE ESTEVE GESTADA EM 2014 QUE TEVE GESTADA&nbsp; DE 6 MESES E NUM ACIDENTE DE VIA&Ccedil;&Atilde;O PERDEU A GESTA&Ccedil;&Atilde;O. SEIS MESES DEPOIS ENGRAVIDOU NOVAMENTE E TEVE. ACTUALMENTE O BEB&Eacute; EST&Aacute; COM 5 ANOS&nbsp;DE GESTA&Ccedil;&Atilde;O. TENTANDO A TERCEIRA GESTA&Ccedil;&Atilde;O, FOI DIAGNOSTICADA OBSTRU&Ccedil;&Atilde;O TUB&Aacute;RIA BILATERAL. N&Atilde;O TEM GIAGN&Oacute;STICO DE MIOMAS UTERINO NEM QUISTO. O PER&Iacute;ODO MENSTRUAL OCORRE REGULARMENTE E SEM QUALQUER ANORMALIDADE.</p>\r\n'),
(322, 440, '2021-02-18', '71.1', '0', '0', '0', NULL, NULL, '2021-02-18', '', '', '', '', '', '<p>PACIENTE COM TRES GESTA&Ccedil;&Atilde;O A PRIMEIRA EM 2011 E ABORTOU AOS 2 MESES, A SEGUNDA EM 2012 TEVE E A TERCEIRA EM 2013 ABORTOU AOS TRES MESES. ACTUALMENTE A PACIENTE EST&Aacute; COM OBSTRU&Ccedil;&Atilde;O TUBARIA BILATERALMENTE, EXAME REALIZADO AOS 17 DE FEVEREIRO DE 2021. PERIODO MENSTRUAL REGULAR.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(323, 441, '2021-02-18', '65.2', '0', '0', '0', NULL, NULL, '2021-02-18', '', '', '', '', '', '<p>Paciente de 45 anos de idade com infec&ccedil;&atilde;o urin&aacute;ria desde 2019. Paciente teve 3 gesta&ccedil;&otilde;es e 1 filho. Fez a Histeroctomia no Hospital Maria Pia&nbsp;por causa da hemorragia uterina intensa e por longos dias.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(324, 380, '2021-02-21', '59.2', '0', '0', '0', NULL, NULL, '2021-03-08', '', '', '', '', '', '<p>PACIENTE DE 37 ANOS DE IDADE,</p>\r\n\r\n<p>COM AMENORREIA A MAIS DE 6 ANOS.</p>\r\n\r\n<p>AP&Oacute;S PERDER A FILHA COM 9 MESES DE GESTA&Ccedil;&Atilde;O, IMPLANTOU O DIO E TIROU AP&Oacute;S 1 ANO E ALGUNS MESES. AP&Oacute;S TER RETIRADO GESTOU E O DIAGN&Oacute;STICO FOI DE GESTA&Ccedil;&Atilde;O ANEEMBRION&Aacute;RIA. EM 2016 FEZ A RASPAGEM E DA&Iacute; AS COMPLICA&Ccedil;&Otilde;ES. EM ESPANHA FEZ A CIRURGIA POR VIDEO LAPAROSCOPIA PARA REMOVER SIN&Eacute;QUIAS UTERINAS ISTO EM 2018.&nbsp;</p>\r\n'),
