(331, 443, '2021-02-22', '102.3', '0', '0', '0', NULL, NULL, '2021-02-22', '', '', '', '', '', '<p>Paciente de 59 Anos de idade, em 2013 fez uma consulta em vinduque onde foi diagnosticada cancer em estado terminal. Da&iacute; foi para Brasil e foi disconfirmada a informa&ccedil;&atilde;o de que tinha cancer. Em 2014 em Cuba&nbsp;no ano de&nbsp;2018 foi a Portugal e a informa&ccedil;&atilde;o foi unanime com a do brasil de que tinha quisto no ov&aacute;rio e n&atilde;o c&acirc;ncer. Foi sugerida a cirurgia por raz&otilde;es do sangramento nas rela&ccedil;&otilde;es sexual.&nbsp;</p>\r\n\r\n<p>No seio direito tinha papiloma, perou na China. Actualmente na ponta do mamilo do seio direito sente a sair secre&ccedil;&atilde;o transparente.</p>\r\n\r\n<p>Actualmente ginecologicamente sente-se bem. Tem restri&ccedil;&otilde;es a alimenta&ccedil;&atilde;o c&aacute;rnea.&nbsp;</p>\r\n'),
(332, 255, '2021-02-22', '0', '0', '0', '0', NULL, NULL, '2021-03-08', '', '', '', '', '', '<p>PACIENTE COM POLIPOS E OBSTRU&Ccedil;&Atilde;O DAS DUAS TROMPAS</p>\r\n'),
