(817, 150, '2021-09-14', '0', '0', '0', '0', NULL, NULL, '2021-09-14', '', '', '', '', '', '<p>&rarr;&nbsp;<strong>Per&iacute;odo de multiplica&ccedil;&atilde;o:</strong>&nbsp;</p>\r\n\r\n<p>ocorrem sucessivas mitoses nas c&eacute;lulas precursoras dos gametas femininos, chamadas de&nbsp;<strong>ovog&ocirc;nias (2n).&nbsp;</strong>Essas divis&otilde;es, que acontecem no epit&eacute;lio germinativo do ov&aacute;rio, ocorrem no in&iacute;cio da fase fetal, indo aproximadamente at&eacute; o terceiro m&ecirc;s de vida.<img alt=\"A espermatogênese é o processo de formação de espermatozoides a partir de células precursoras chamadas de espermatogônias\" src=\"https://s1.static.brasilescola.uol.com.br/be/conteudo/images/215c086f22df3cc3bbd5be5cbfce0b61.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&rarr;<em>&nbsp;Per&iacute;odo de crescimento:</em>&nbsp;No per&iacute;odo de crescimento, as ovog&ocirc;nias come&ccedil;am a acumular subst&acirc;ncia de reserva (vitelo) e aumentam em volume. Nessa etapa, elas passam a ser chamadas de<strong>&nbsp;ov&oacute;citos prim&aacute;rios ou ov&oacute;citos I (2n).</strong></p>\r\n\r\n<p>&rarr;&nbsp;<strong>Per&iacute;odo de matura&ccedil;&atilde;o:</strong>&nbsp;No per&iacute;odo de matura&ccedil;&atilde;o, inicia-se o processo de meiose, por&eacute;m este n&atilde;o se completa e os ov&oacute;citos prim&aacute;rios estacionam na pr&oacute;fase I. A meiose continuar&aacute; apenas ap&oacute;s estimula&ccedil;&atilde;o do horm&ocirc;nio FSH (horm&ocirc;nio estimulante do fol&iacute;culo), que ocorre na puberdade.</p>\r\n'),
