(1259, 938, '2022-06-14', '95', '170', '134/92', '82', NULL, NULL, '2022-06-14', '', '', '', '', '', '<p>Paciente sem desejo sexual e com secura vaginal. Sente ardor ap&oacute;s a ejacula&ccedil;&atilde;o.&nbsp;</p>\r\n'),
(1260, 939, '2022-06-14', '68', '167', '114/86', '76', NULL, NULL, '2022-06-14', '', '', '', '', '', ''),
(1261, 996, '2022-06-14', '92.9', '176', '176/119', '72', NULL, NULL, '2022-06-14', '', '', '', '', '', '<p>Paciente com incontineia urin&aacute;ria, jato urin&aacute;rio baixo, dores lombares e impot&ecirc;ncia sexual.</p>\r\n'),
(1262, 997, '2022-06-15', '41', '157', '143/70', '73', NULL, NULL, '2022-06-15', '', '', '', '', '', '<p>Paciente G1 (2009) P1 A0. Menstrua&ccedil;&atilde;o IRREGULAR. Ardor vagianal.</p>\r\n'),
(1263, 91, '2022-06-15', '54', '167', '165/97', '71', NULL, NULL, '2022-07-29', '', '', '', '', '', '<p>Irrita&ccedil;&atilde;o na garganta, tosse, falta de apetite, furunculo, diarreia e perca de peso. Paciente seropositivo.&nbsp;</p>\r\n'),
(1264, 984, '2022-06-15', '72', '182', '152/107', '72', NULL, NULL, '2022-06-29', '', '', '', '', '', '                                                            <p>Paciente apresentou os resultados de exames que dão conta da presença de <strong>hidrocele</strong> e <strong>varicocele </strong>do lado direito.</p>\r\n                                                        '),
(1265, 984, '2022-06-15', '72', '182', '0', '0', NULL, NULL, '2022-06-15', '', '', '', '', '', '<ul>\r\n	<li><strong>LY MPHSHAMEI </strong>8Cx</li>\r\n</ul>\r\n\r\n<p><strong>T</strong>omar 2 c&aacute;psulas&nbsp;de 8 em 8 horas. 6h/14h/22h.</p>\r\n\r\n<ul>\r\n	<li><strong>PROSTAT</strong></li>\r\n</ul>\r\n\r\n<p><strong>T</strong>omar 2 c&aacute;psulas&nbsp;de 6 em 6 horas. 6h/12h/18h.</p>\r\n\r\n<ul>\r\n	<li><strong>MULTI MAX</strong></li>\r\n</ul>\r\n\r\n<p><strong>T</strong>omar 1&nbsp;comprimido&nbsp;de 8 em 8 horas. 6h/14h/22h.</p>\r\n\r\n<ul>\r\n	<li><strong>ESPERMING</strong></li>\r\n</ul>\r\n\r\n<p><strong>T</strong>omar 20 pilulas de 8 em 8 horas. 6h/14h/22h.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>T/60 dias Plus</p>\r\n\r\n<p>Proxima Revis&atilde;o: 29/06/2022</p>\r\n'),
(1266, 999, '2022-06-15', '54', '160', '114/170', '77', NULL, NULL, '2022-06-15', '', '', '', '', '', '<p>Paciente G4 P1 (2013) A3 (2016&nbsp;e 2017) Menstrua&ccedil;&atilde;o irregur, dor ao apertar a beixiga, dores no acto sexual, dores de beixiga, ao urinar, enjoo,&nbsp;constante e pontada.&nbsp;&nbsp;</p>\r\n'),
(1267, 998, '2022-06-15', '0', '0', '0', '0', NULL, NULL, '2022-06-15', '', '', '', '', '', '<p>Paciente G4 A4 ( 2019, 2021e 2022) com quadro de aborto de repeti&ccedil;&atilde;o.</p>\r\n\r\n<p>Historico de infec&ccedil;&atilde;o urin&aacute;ria recorrente ap&oacute;s a gesta&ccedil;&atilde;o.&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(1268, 1000, '2022-06-20', '82', '170', '146/106', '74', NULL, NULL, '2022-06-20', '', '', '', '', '', '<p>Casal tem 1 filho&nbsp;de 9 anos e da&iacute; n&atilde;o consegue alcan&ccedil;ar!&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(1269, 1001, '2022-06-20', '87', '167', '148/102', '75', NULL, NULL, '2022-06-20', '', '', '', '', '', '<p>Casal tem 1 filho&nbsp;de 9 anos e da&iacute; n&atilde;o consegue alcan&ccedil;ar!&nbsp;</p>\r\n\r\n<p>G1 (2012) P1 A0. Periodo menstrual regular com dor nos dias inicial.&nbsp;&nbsp;</p>\r\n'),
(1270, 287, '2022-06-20', '75', '160', '128/82', '77', NULL, NULL, '2022-06-20', '', '', '', '', '', ''),
(1271, 995, '2022-06-20', '77', '159', '119/80', '77', NULL, NULL, '2022-07-04', '', '', '', '', '', '                                                            <p>VS: 84</p>\r\n                                                        '),
(1272, 1003, '2022-06-20', '82', '160', '123/78', '75', NULL, NULL, '2022-06-20', '', '', '', '', '', '<p>Paciente G6 P1 (por cesariana em 2002) A5 (de 2007 a 2020) Periodo menstrual irregular.&nbsp;</p>\r\n\r\n<p>O casal deseja engravidar.</p>\r\n'),
(1273, 1004, '2022-06-20', '70', '165', '122/84', '70', NULL, NULL, '2022-06-20', '', '', '', '', '', '                                                            <p>Paciente G3 A1 A2, menstruação regular.</p>\r\n\r\n<p>Duas gestações ectopicas, DIP e miomas uterino.  Paciente Seropositiva</p>\r\n                                                        ');
INSERT INTO `fichaclinica` (`id`, `idpaciente`, `data1`, `peso`, `altura`, `pa`, `pulso`, `temperatura`, `idcardapio`, `data2`, `anexo1`, `anexo2`, `anexo3`, `anexo4`, `anexo5`, `descricao`) VALUES
(1274, 1006, '2022-06-21', '47', '160', '153/101', '79', NULL, NULL, '2022-06-21', '', '', '', '', '', '<p>Paciente Tosse a mais de 1 m&ecirc;s, abd&oacute;men inflamado (ASCITE).</p>\r\n'),
(1275, 880, '2022-06-21', '64', '1.69', '128/89', '73', NULL, NULL, '2022-06-21', '', '', '', '', '', ''),
(1276, 849, '2022-06-21', '81', '160', '150/101', '80', NULL, NULL, '2022-07-06', '', '', '', '', '', '<p>Sangramento intermitente.</p>\r\n'),
(1277, 472, '2022-06-21', '0', '0', '0', '0', NULL, NULL, '2022-06-21', '', '', '', '', '', '<p>Paciente G3 P0 A3 (as dezassete anos e 2018) Com uma trompa imperme&aacute;vel.</p>\r\n\r\n<p>Amenorreia a 5 meses.</p>\r\n'),
(1278, 1007, '2022-06-22', '97', '161', '125/89', '97', NULL, NULL, '2022-06-22', '', '', '', '', '', '                                                            <p>G2 P2 (COM 17 SEMANAS 2015 E 25 SEMANAS EM 2017)  ISTMO CERVICA (CERCLAGE) NA ULTIMA gestação.</p>\r\n\r\n<p>PERIODO MENSTRUAL IRREGULAR. MIOMECTOMIA EM 2015 POR VIDEOLAPAROSCOPIA EM PORTUGAL E POLIPOTOMIA. </p>\r\n                                                        '),
(1279, 1008, '2022-06-22', '86', '183', '145/94', '64', NULL, NULL, '2022-06-22', '', '', '', '', '', '<p>Altera&ccedil;&atilde;o no aparelho reprodutor, ejacula&ccedil;&atilde;o precoce. Hipertens&atilde;o arterial.</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(1280, 1009, '2022-06-22', '85', '180', '137/89', '70', NULL, NULL, '2022-06-22', '', '', '', '', '', '<p>Paciente G5 P0 A5 (o ultimo em 2011) Menstrua&ccedil;&atilde;o IRREGULAR. Fortes contra&ccedil;&otilde;es no baixo ventre duas semanas antes do periodo menstrual. Corrimentos e infec&ccedil;&atilde;o urinaria de repeti&ccedil;&atilde;o!&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(1281, 974, '2022-06-28', '47', '0', '120-80', '55', '37', NULL, '2022-06-28', '', '', '', '', '', '<p>Dores no estomago que irradia at&eacute; a beixiga.</p>\r\n'),
(1282, 1002, '2022-06-29', '74', '', '105/73', '74', '0', NULL, '2022-07-13', '', '', '', '', '', '                                                            <p>G1 P0 A1 </p> com adenomiosa.\r\n\r\n<p>Paciente sem esposo, realizou processo da FIV na Africa do sul, sem sucesso. Na Africa do sul tem embriões congelados.</p>\r\n                                                        '),
(1283, 1011, '2022-06-29', '0', '0', '0', '0', '0', NULL, '2022-06-29', '', '', '', '', '', '<p>G2 P2 A0&nbsp;</p>\r\n\r\n<p>Fez a FIV em Portugal com sucesso em 2016.&nbsp;</p>\r\n\r\n<p>A paciente tem embri&otilde;es em Portugal.&nbsp;</p>\r\n\r\n<p>A paciente deseja ter um rapaz.</p>\r\n\r\n<p>&nbsp;</p>\r\n');
