(8, 695, '<p><strong>VIMAX: </strong>Tomar 2&nbsp;comprimidos ???? duas vezes ao dia. 6h e 18h.</p>\r\n\r\n<p><strong>CANGURU:</strong> Tomar 2 comprimidos tr&ecirc;s vezes ao dia. 7h, 13h e 19h.</p>\r\n\r\n<p><strong>REPRODUTIV MASC.</strong>: Tomar 1 ch&aacute;vena ???? das de caf&eacute; 4 vezes ao dia. 6h, 10h, 14h e 18h.</p>\r\n\r\n<p>OBS.: Durante o tratamento &eacute; imperioso a abstin&ecirc;ncia de alimentos e bebidas nocivos tais como: Fritos e&nbsp;Bebidas alco&oacute;licas.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>T- 45 Dias Esp.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2021-09-13 00:09:54'),
(9, 719, '<p><strong>OSOMPO:</strong> Tomar 2 c&aacute;psulas 2 de 12 em 12h. 6h e 18h.</p>\r\n\r\n<p><strong>REPRODUCTIV feminino</strong>: Tomar 1 ch&aacute;vena das de caf&eacute; 4 vezes ao dia. 6h, 10h, 14h e 18h.</p>\r\n\r\n<p><strong>VITAMINA E</strong>: Tomar 2&nbsp;c&aacute;psulas 2 de 12 em 12h. 6h e 18h.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2021-09-13 06:09:12'),
(10, 79, '<p><strong>Reprodutiv Feminio:</strong>&nbsp;Tomar 1 ch&aacute;vena&nbsp;a das de caf&eacute; de 4 em 4 horas. 6h/10h/14/18h.</p>\r\n', '2021-09-14 00:09:01'),
