(12, 718, '<p><strong>ANTITUMORAL 2L:</strong> Tomar 1 ch&aacute;vena das de ch&aacute; 4 vezes ao dia. 6h/10h/14h/18h.</p>\r\n\r\n<p><strong>OSOMPO:&nbsp;</strong>Tomar 3c 2 vezes ao dia. 7h/19h</p>\r\n\r\n<p><strong>DETOX:&nbsp;</strong>Tomar 2c 3 vezes ao dia. 6h/12h/18h.</p>\r\n\r\n<p><strong>ADOM KOOK:&nbsp;</strong>Tomar 3c 2 vezes ao dia. 8h/20h</p>\r\n', '2021-09-14 05:09:23'),
