(14, 575, '<p><strong>Antitumorico 2L:&nbsp;</strong>Tomar 1 ch&aacute;vena das de caf&eacute; 4 x ao dia, de 4&nbsp;em 4h. 6h/10h/14h/18h.</p>\r\n\r\n<p><strong>Ganoderma:&nbsp;</strong>Tomar 2c 2 vezes ao dia, de 12 em 12h. 7h/19h.</p>\r\n', '2021-09-15 07:09:22'),
(15, 725, '<ul>\r\n	<li>&nbsp;<strong>GENECURY 4L</strong></li>\r\n</ul>\r\n\r\n<p>Limpeza &iacute;ntima com seringa insufl&aacute;vel 100ml&nbsp;2 vezes ao dia. Manh&atilde; e noite.</p>\r\n\r\n<ul>\r\n	<li><strong>REPRODUTI PLUS 4L</strong></li>\r\n</ul>\r\n\r\n<p>Tomar em ch&aacute;venas de caf&eacute; 4 vezes ao dia. 6h/10h/14h/18h.</p>\r\n\r\n<ul>\r\n	<li><strong>ANTITUMORAL 4L</strong></li>\r\n</ul>\r\n\r\n<p>Tomar em ch&aacute;venas de caf&eacute; 4 vezes ao dia. 6h/10h/14h/18h.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>T-60 DIAS PLUS</p>\r\n', '2021-09-20 00:09:02'),
(16, 726, '<ul>\r\n	<li><strong>REPRODUTIV FEMENINO</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 2 c&aacute;psulas&nbsp;3 vezes ao dia de 8 em 8h. &nbsp; &nbsp;6h / 14h /&nbsp;22h.</p>\r\n\r\n<ul>\r\n	<li><strong>ANTITUMORAL 4L</strong>???????</li>\r\n</ul>\r\n\r\n<p>Tomar em ch&aacute;venas das de caf&eacute;, 4 vezes ao dia. 6h / 10h / 14h / 18h.</p>\r\n\r\n<ul>\r\n	<li><strong>GANODERMA</strong></li>\r\n</ul>\r\n\r\n<p><strong>???????</strong>Tomar 2 c&aacute;psulas 2 vezes ao dia. 6h / 18h.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>T - 35 Dias Especial.</p>\r\n\r\n<p>Pr&oacute;xima Revis&atilde;o: <strong>04/10/2021</strong></p>\r\n', '2021-09-20 01:09:41'),
(17, 652, '<ul>\r\n	<li><strong>REPRODUTIV FEMENINO</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 2 ca?psulas 3 vezes ao dia de 8 em 8h. &nbsp;6H /14H / 22H.</p>\r\n\r\n<ul>\r\n	<li><strong>ANTITUMORAL 4L</strong></li>\r\n</ul>\r\n\r\n<p>Tomar em cha?venas das de cafe?, 4 vezes ao dia. 6h / 10h / 14h / 18h.</p>\r\n\r\n<ul>\r\n	<li><strong>GANODERMA</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 2 ca?psulas 2 vezes ao dia. 6h / 18h.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pr&oacute;xima Revis&atilde;o: 04/10/2021</p>\r\n', '2021-09-20 01:09:52'),
(18, 652, '<ol>\r\n	<li>HCG - Horm&oacute;nio Gonadotofinico Corionico &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 25.5mIU/ml</li>\r\n</ol>\r\n\r\n<p>Valores de Referencia</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>BhCG abaixo de 5 mIU/ml:&nbsp;</strong>resultado negativo, n&atilde;o h&aacute; ind&iacute;cio de gravidez.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>BhCG entre 5 e 25 mIU/ml</strong>: resultado indefinido. &Eacute; recomendado repetir o exame ap&oacute;s tr&ecirc;s dias para ter certeza sobre a gesta&ccedil;&atilde;o.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>BhCG acima de 25 mIU/ml:</strong>&nbsp;resultado positivo, indica gravidez.</p>\r\n	</li>\r\n</ul>\r\n', '2021-09-20 02:09:16'),
(19, 403, '<ul>\r\n	<li><strong><font color=\"#000000\">MELATONINA</font></strong></li>\r\n</ul>\r\n\r\n<p><font color=\"#000000\">Tomar 2c 3 vezes ao dia. 6h/14h/22h.</font></p>\r\n\r\n<ul>\r\n	<li><font color=\"#000000\"><strong>MAGNESIO</strong></font></li>\r\n</ul>\r\n\r\n<p><font color=\"#000000\">Tomar 1 chavena das de&nbsp;<span style=\"caret-color:#0433ff\">caf&eacute; 3 vezes ao dia. 7h/13h/20h.</span></font></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><font color=\"#000000\"><span style=\"caret-color:#0433ff\">Recomenda&ccedil;&atilde;o: Tomar suco&nbsp;de pepino ???? &nbsp;com&nbsp;lim&atilde;o (instant&acirc;neo) 1&nbsp;lim&atilde;o ???? 1 pepino.</span></font></p>\r\n\r\n<p><font color=\"#000000\"><span style=\"caret-color:#0433ff\">Beber ao longo do dia no&nbsp;m&iacute;nimo 2 litros de&nbsp;&Aacute;gua.&nbsp;</span></font></p>\r\n', '2021-09-21 03:09:30'),
(20, 282, '<p><strong>Arab Ba</strong></p>\r\n\r\n<p>Tomar 2c 3 vezes ao dia. 6h/12h/18h.</p>\r\n\r\n<p><strong>W &amp; G</strong></p>\r\n\r\n<p>Tomar 2c 2 vezes ao dia 8h/20h.</p>\r\n\r\n<p><strong>Pilgenic</strong></p>\r\n\r\n<p>Tomar 10 pilulas 2 vezes ao dia. 7h/19h</p>\r\n\r\n<p><strong>Vitamina E</strong></p>\r\n\r\n<p>Tomar 2c duas vezes ao dia. 10h/16h.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>T-60 Dias esp. Pr&oacute;xima Revis&atilde;o aos 05/10/2021.</p>\r\n', '2021-09-22 05:09:50'),
