(237, 648, '<ul>\r\n	<li><strong>Artemether</strong> 80 mg /1ml &nbsp;6 ampolas</li>\r\n</ul>\r\n\r\n<p>Primeiro dia 160 mg</p>\r\n\r\n<p>Segundo ao quinto dia 80mg</p>\r\n\r\n<ul>\r\n	<li><strong>Clavamox</strong>&nbsp;&nbsp;500+125mg. &nbsp;14 c</li>\r\n</ul>\r\n\r\n<p>Tomar 1 comprimido de 12 em 12 horas. 6h/18h.</p>\r\n\r\n<ul>\r\n	<li><strong>Complexo B 12 c</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 1 comprimido ao dia.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Beber liquidos em abund&acirc;ncia.</p>\r\n', '2022-02-28 03:02:58'),
