(458, 988, '<ul>\r\n	<li><strong>PRIMROSE</strong></li>\r\n</ul>\r\n\r\n<p>TOMOAR 2 CAPSULAS&nbsp; DUAS VEZES AO DIA. 6h/18h.</p>\r\n\r\n<ul>\r\n	<li><strong>LAXATIV</strong></li>\r\n</ul>\r\n\r\n<p>TOMOAR 2C DUAS VEZES AO DIA. 7h/19h.</p>\r\n\r\n<ul>\r\n	<li><strong>Q10</strong></li>\r\n</ul>\r\n\r\n<p>TOMOAR 2C DUAS&nbsp; 3 VEZES AO DIA. 6h/12h/18h.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Proxima revis&atilde;o; 06/07/2021 Nesta data aplicar a via SC ampolas.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2022-06-22 05:06:58'),
(459, 989, '<ul>\r\n	<li><strong>SPERMING</strong></li>\r\n</ul>\r\n\r\n<p>TOMOAR (METODO comest&iacute;vel ) 20 PILULAS 3 VEZES AO DIA. 6h/12h/18h.</p>\r\n\r\n<ul>\r\n	<li><strong>180 POW</strong></li>\r\n</ul>\r\n\r\n<p>TOMOAR 2C DUAS VEZES AO DIA. 7h/19h.</p>\r\n\r\n<ul>\r\n	<li><strong>MULTNATUR 30C</strong></li>\r\n</ul>\r\n\r\n<p>TOMOAR 1C&nbsp; DUAS VEZES AO DIA. 6h/18h.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Proxima revis&atilde;o; 06/07/2021 <strong><em>Aplica&ccedil;&atilde;o SC ampolas.</em></strong></p>\r\n', '2022-06-22 05:06:38'),
(460, 623, '<ul>\r\n	<li><strong>AZITROMICINA 500mg (3c)</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 1 comprimido ao dia.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Repetir o exame ao 05&nbsp;- 07 - 2022</p>\r\n', '2022-06-28 02:06:00'),
(461, 627, '<ul>\r\n	<li><strong>VELVET MATERNO</strong></li>\r\n</ul>\r\n\r\n<p>TOMAR 1 COMPRIMIDO AO DIA.</p>\r\n', '2022-06-28 03:06:46'),
(462, 974, '<ul>\r\n	<li><strong>ELIXIR</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 1 colher das de sopa de 4 em 4 horas. 6h-10h-14h-18h.</p>\r\n\r\n<ul>\r\n	<li><strong>GANODERMA</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 2 capsulas de 6 em 6 horas. 6h-12h-18h.</p>\r\n\r\n<ul>\r\n	<li><strong>VICOMBIL</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 1 comprimido de 12 em 12 horas. 6h -18h.</p>\r\n\r\n<ul>\r\n	<li><strong>MULTIMATURI</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 1 comprimido de 12 em 12 horas. 7h -19h.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Proxima Consulta</strong>: 13 - 07 - 2022.</p>\r\n', '2022-06-28 03:06:10'),
(463, 974, '<ul>\r\n	<li><strong>ELIXIR</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 1 colher das de sopa de 4 em 4 horas. 6h-10h-14h-18h.</p>\r\n\r\n<ul>\r\n	<li><strong>GANODERMA</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 2 capsulas de 6 em 6 horas. 6h-12h-18h.</p>\r\n\r\n<ul>\r\n	<li><strong>VICOMBIL</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 1 comprimido de 12 em 12 horas. 6h -18h.</p>\r\n\r\n<ul>\r\n	<li><strong>MULTIMATURI</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 1 comprimido de 12 em 12 horas. 7h -19h.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Proxima Consulta</strong>: 13 - 07 - 2022.</p>\r\n', '2022-06-28 03:06:10'),
(464, 915, '<ul>\r\n	<li><strong>WOMB TEA </strong>(2 Cx)</li>\r\n</ul>\r\n\r\n<p>Tomar 1 chavenas das de ch&aacute; de 4 em 4 horas. 6h/10h/14h/18h.&nbsp;&nbsp;<strong>Modo de Preparo:</strong> Infus&atilde;o.</p>\r\n\r\n<ul>\r\n	<li><strong>FEMALE REPRODUTIV&nbsp;</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 2 c&aacute;psulas de 8 em 8 horas. 6H/14H/22H.</p>\r\n\r\n<ul>\r\n	<li><strong>OSOMBO</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 2 c&aacute;psulas de 12 em 12 horas. 6H/18H.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Proxima Revis&atilde;o: 20/07/2022&nbsp;</em></strong></p>\r\n', '2022-06-28 03:06:37'),
(465, 969, '<ul>\r\n	<li><strong>FEMALE REPRODUTIV</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 2 c&aacute;psulas de 8 em 8 horas. 6h/14h/22h.</p>\r\n\r\n<ul>\r\n	<li><strong>WOMB TEA</strong></li>\r\n</ul>\r\n\r\n<p>???????Tomar 1 ch&aacute;vena das de ch&aacute;&nbsp;de 6 em 6 horas. 6h/12h/18h.</p>\r\n\r\n<ul>\r\n	<li><strong>MULTMANTUR</strong></li>\r\n</ul>\r\n\r\n<p>???????Tomar 1 comprimido de 12 em 12 horas. 6h/18h.</p>\r\n\r\n<ul>\r\n	<li><strong>PILGENIC</strong></li>\r\n</ul>\r\n\r\n<p>???????Tomar 10 p&iacute;lulas&nbsp;de 12 em 12 horas. 6h/18h.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Proxima revis&atilde;o:</strong> 13/07/2022</p>\r\n', '2022-06-29 00:06:10'),
(466, 987, '<ul>\r\n	<li><strong>ADOM KOOK</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 1 comprimido de 12 em 12 horas. 6h/18h.</p>\r\n\r\n<ul>\r\n	<li><strong>ROOT TONIC</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 1 ch&aacute;vena das de caf&eacute;&nbsp;de 4 em 4 horas. 6h/10h/14h/18h.</p>\r\n\r\n<ul>\r\n	<li><strong>MULTMANTUR</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 1 comprimido de 12 em 12 horas. 6h/18h.</p>\r\n\r\n<ul>\r\n	<li><strong>GANODERMA</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 2 comprimidos&nbsp;de 6 em 6&nbsp;horas. 6h/12h/18h.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Proxima revis&atilde;o: 13/07/2022</p>\r\n', '2022-06-29 02:06:49'),
(467, 832, '<ul>\r\n	<li><strong>LY MPHSHAMEI 5cx</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 2 c&aacute;psulas&nbsp; de 8 em 8h. 6h/14h/22h.</p>\r\n\r\n<ul>\r\n	<li><strong>NATUR MULT 15C</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 1c ao dia. Preferencialmentre as 8h.</p>\r\n\r\n<ul>\r\n	<li><strong>WOMB TEA</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 1 ch&aacute;vena das de ch&aacute; &nbsp;em infusao de 6 em 6h. 6h/12h/18h.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<blockquote>\r\n<p><strong><em>Proxima Consulta: 13/07/2022</em></strong></p>\r\n</blockquote>\r\n', '2022-06-29 03:06:12'),
(468, 990, '<ul>\r\n	<li><strong>ADOM KOOK</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 2 capsulas de 12 em 12h. 6h/18h.</p>\r\n\r\n<ul>\r\n	<li><strong>NATUR MULT 15C</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 1c ao dia. Preferencialmentre as 8h.</p>\r\n\r\n<ul>\r\n	<li><strong>GANODERMA</strong></li>\r\n</ul>\r\n\r\n<p>Tomar 2 comprimidos de 12 em 12h. 7h/19h.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em><strong>T/45 Dias&nbsp;</strong></em></p>\r\n\r\n<p><em><strong>Proxima Revis&atilde;o: </strong>13/06/2022</em></p>\r\n', '2022-06-29 04:06:58');
