INSERT INTO `site` (`logotipo`, `telefone1`, `telefone2`, `email`, `dias`, `horas`, `facebook`, `instagram`, `slide_img1`, `slide_txt1`, `slide_img2`, `slide_txt2`, `slide_img3`, `slide_txt3`, `nota_titulo`, `nota_descricao`, `nota_autor`, `nota_cargo`, `servico`, `servico_titulo`, `servico_titulo1`, `servico_descricao1`, `servico_titulo2`, `servico_descricao2`, `servico_titulo3`, `servico_descricao3`, `servico_titulo4`, `servico_descricao4`, `servico_titulo5`, `servico_descricao5`, `id`, `btn1`, `btn2`, `servico_img1`, `servico_img2`, `servico_img3`, `servico_img4`, `servico_img5`, `nota_img`) VALUES
('614355f5a5b99.png', ' +244 923 066 230', '', 'geral@clinicadaisywell.com', 'Segunda - Domingo  ', '08:00 - 17:00', 'https://www.facebook.com/clinicadaisywell', 'https://www.instagram.com/clinicadaisywell/', '61435cd6c558d.jpg', 'O novo conceito de medicina reprodutiva', '61435d504644e.jpg', 'A sua saúde nosso maior objectivo.', '61435d5047f15.jpg', 'Onde o seu futuro começa. ', 'Manter a Fé', '\"Às vezes, perdemos a fé e a esperança por conta das dificuldades e limitações que todos os casais tentantes passam. Mas é importante falarmos sobre a fé. Não desista de tentar, pois em breve você terá um lindo bebê em seu ventre.\" ', 'Laurindo Tchilima', 'Especialista em Saúde Reprodutiva', 'SERVIÇOS', 'SERVIÇOS', 'Consulta de Especialidade Reprodutiva', 'O Doutor recebe o casal e, através de uma entrevista exaustiva sobre historial clínico (patologias, cirurgias), hábitos de vida (stress, alimentação, medicação) e actividade sexual, bem como a análise de exames médicos prévios, traça o historial de ambos os elementos. Esta etapa é importante, uma vez que detectar situações, algumas até de resolução simples, que podem estar a comprometer a fertilidade.', 'Inseminação Artificial', 'A inseminação artificial, também conhecida como inseminação intra-uterina (IIU), é uma técnica de reprodução assistida em que o sémen é depositado directamente na cavidade uterina da mulher durante o período fértil, aumentando assim as chances de conceber uma gravidez, especialmente em casos de infertilidade.', 'Inseminação in Vitro', 'Na fertilização in vitro a produção ovariana da mulher é estimulada para que haja mais óvulos em comparação à produção natural. Em seguida, os óvulos são captados através de uma punção guiada por um ultrassom transvaginal e fertilizados pelos espermatozoides em laboratório.', 'Transferência de embriões', 'A transferência embrionária ocorre com a utilização de um tubo fino e flexível (cateter) dentro do útero por meio do orifício externo do colo uterino. Uma seringa com um ou mais embriões em suspensão no fluido estará ligada à extremidade do cateter para que o fluido seja empurrado para dentro do útero através do tubo. ', 'Exame', 'Todos os exames necessarios para o procedimento de Inseminacao Artificial ou Inseminação in VITRO', 1, 'Agendar Consulta', 'Ver Exame', '6143614b7f563.png', '6143614b85a48.png', '6143614b8794e.png', '6143614b8de87.png', '6143614b920b9.png', '61630ecf05d77.png');
